road a Dream or Reality?â€ organized by the AYBU Software Engineering Club (ASEC), students who have personally turned this dream into reality will share their experiences with you.\r\n\r\nDuring the event, you will have the opportunity to gain firsthand information about Erasmus study mobility, Erasmus+ internship programs, Work and Travel experiences, capstone projects, and candidate engineering processes.\r\n\r\nOur speakers will discuss their application journeys, the challenges they faced, the experiences they gained, and how these opportunities contributed to their careers.\r\n\r\nAt the end of the event, participants will be able to ask the speakers any questions they may have directly.\r\n\r\nDetailed Program Schedule\r\n\r\n11:00â€“11:10 | Erasmus Study Mobility (1/2) â€” 3rd-year student Can KankÄ±lÄ±Ã§\r\n11:10â€“11:20 | Erasmus Study Mobility (2/2) â€” 3rd-year student Furkan Aydos\r\n11:20â€“11:35 | Erasmus Internship Mobility â€” 3rd-year student RÃ¼veyda AkÃ§a\r\n11:35â€“11:45 | Work and Travel (1/2) â€” 3rd-year student Ä°layda AkÄ±net\r\n11:45â€“11:55 | Work and Travel (2/2) â€” 3rd-year student Sencer Yavuz\r\n12:00â€“12:10 | Capstone Projects â€” Research Assistant KÃ¼branur GÃ¼mÃ¼ÅŸlÃ¼\r\n12:10â€“12:20 | Candidate Engineering â€” Research Assistant KÃ¼branur GÃ¼mÃ¼ÅŸlÃ¼','2025-05-06','11:00 - 13:00','Etlik BatÄ± KampÃ¼sÃ¼ A Blok, 2. Kat Konferans Salonu','',NULL),(5,'Koddaki SÄ±nÄ±rlarÄ± AÅŸmak: ASEC Bahar PikniÄŸi','Going Beyond Code: ASEC Spring Picnic','YazÄ±lÄ±m dÃ¼nyasÄ±nda uzun saatler ekran baÅŸÄ±nda vakit geÃ§irmek genellikle saÄŸlÄ±ÄŸÄ±mÄ±zÄ± olumsuz etkiler ve sosyal etkileÅŸimlerimizi zayÄ±flatÄ±r. Ancak biliyoruz ki, alanÄ±mÄ±zda baÅŸarÄ± sadece iyi kod yazan bireylerden deÄŸil, aynÄ± zamanda kendini ifade edebilen ve etkili iletiÅŸim kurabilen takÄ±m oyuncularÄ±ndan da gelir. Bu doÄŸrultuda, ASEC YazÄ±lÄ±m MÃ¼hendisliÄŸi KulÃ¼bÃ¼ olarak 4 MayÄ±s Pazar gÃ¼nÃ¼ Harikalar DiyarÄ±â€™nda bir piknik dÃ¼zenledik. Piknik boyunca kulÃ¼p Ã¼yele